HQ rare promo music video from a promo DVD. &quot;Paint It, Black&quot; is a song released by The Rolling Stones on 13 May 1966 as the first single from the US version of their fourth album Aftermath. It was originally titled &quot;Paint It Black&quot; without a comma. Keith Richards has stated that the comma was added by the record label, Decca.

The song was written by Mick Jagger and Keith Richards. Mick Jagger wrote the lyrics and Keith Richards wrote the music.

Bill Wyman claims in his books that the song was a group effort although it was credited to Jagger/Richards.

The single reached number one in both the United States and the United Kingdom charts in 1966. In 2004 it was ranked number 176 on Rolling Stone magazine's list of the 500 Greatest Songs of All Time. In the US and UK, it was the first number one single to feature a sitar.

The Rolling Stones are an English rock band formed in London in 1962. In the vanguard of the British Invasion of bands that became popular in the US from 1964 Ã¢â‚¬â€œ 65 and symbols of rebellious youth, the Rolling Stones were also instrumental in making blues a major part of rock and roll, and of changing the international focus of blues culture to the more primitive blues typified by John Lee Hooker and by Chess Records artists such as Muddy Waters, writer of &quot;Rollin' Stone&quot;, the song after which the band is named.

The Rolling Stones were inducted into the Rock and Roll Hall of Fame in 1989, and the UK Music Hall of Fame in 2004. Rolling Stone magazine ranked them fourth on the &quot;100 Greatest Artists of All Time&quot; list and their estimated album sales are above 200 million. They have released twenty-four studio albums, eleven live albums and numerous compilations. Sticky Fingers (1971) was their first of eight consecutive number one studio albums in the United States. In 2008 the Rolling Stones ranked 10th on the &quot;Billboard Hot 100 All-Time Top Artists&quot; chart.
